drop table if exists sys_message;

drop table if exists sys_sequence;

drop table if exists sys_user_message;

/*==============================================================*/
/* Table: sys_message                                           */
/*==============================================================*/
create table sys_message
(
   id                   bigint(20) not null auto_increment comment '主键id',
   type                 int(3) not null comment '消息类型(0:系统通知;1:证照提醒)',
   title                varchar(128) not null comment '标题',
   description          varchar(256) comment '简介',
   content              longtext comment '内容',
   status               int(1) not null comment '状态(0:草稿;1:已发布;2:已删除)',
   create_id            bigint(20) comment '创建人id',
   create_time          datetime comment '创建时间',
   edit_id              bigint(20) comment '修改人id',
   edit_time            datetime comment '修改时间',
   publish_time         datetime comment '发布时间',
   primary key (id)
);

alter table sys_message comment '系统消息';

/*==============================================================*/
/* Table: sys_sequence                                          */
/*==============================================================*/
create table sys_sequence
(
   id                   bigint(20) not null auto_increment comment '主键id',
   seq_code             varchar(64) not null comment '序列编码',
   seq_name             varchar(128) not null comment '序列名称',
   seq_prefix           varchar(128) not null comment '序列前缀',
   format_length        int(1) not null comment '格式化长度',
   current_val          bigint(20) not null comment '当前值',
   primary key (id)
);

alter table sys_sequence comment '系统序列';

/*==============================================================*/
/* Table: sys_user_message                                      */
/*==============================================================*/
create table sys_user_message
(
   id                   bigint(20) not null auto_increment comment '主键id',
   message_id           bigint(20) not null comment '消息id',
   user_id              bigint(20) not null comment '阅读者id',
   dept_id              varchar(64) not null comment '所属机构',
   status               int(1) not null comment '状态(0:未读;1:已读;2:删除)',
   read_time            datetime comment '阅读时间',
   primary key (id)
);

alter table sys_user_message comment '系统用户消息';
